webpackJsonp([73357168489667],{5663:function(t,e){t.exports={data:{post:{html:'<p>Note to self: <a href="http://iowa.weblogger.com/2002/07/24">Iowa John</a> saw a presentation on a PHP framework called <a href="http://www.sea-incorporated.com/index.php?_p=xmlContent&_xml=plankton">Plankton</a>. It looks like something I could use starting last week. Take a look at it when you get to work. <b>Later</b> Looks promising, very object-oriented, with classes for basic tasks like HTML, DB, XML. The documentation is still incomplete, so for now learning means poking around yourself. It can\'t be mastered in a day, but maybe in two or three? I\'ll keep an eye on it.</p>',fields:{title:"Plankton",date:"25 Jul 2002",url:"https://papascott.de/2002-07-25-plankton/"}}},pathContext:{slug:"/2002-07-25-plankton/",prev:{fields:{title:"I Hate Banks",date:"24 Jul 2002",slug:"/2002-07-24-i-hate-banks/"}},next:{fields:{title:"Payment In Kind",date:"30 Jul 2002",slug:"/2002-07-30-payment-in-kind/"}}}}}});
